import React from 'react';
import { View, Text, StyleSheet } from 'react-native';
const Test = () => {
    const styles = StyleSheet.create({
        container: {
          flex: 1,
          justifyContent: 'center',
          alignItems: 'center',
        },
      });
    return (
        <View style={styles.container}>
          <Text>Hello, World!</Text>
        </View>
      );
    };
    


export default Test;
